import React from 'react';
// import './App.css';

function answer(props, answ) {
    // props.changeMsg(props.name);
    props.append(answ);
}

// function Ask (props) {
//     if (props.msg)
//         props.append("wtf?");
//     return <div></div>
// }

function Table (props) {

    if (props.name !== "") {
        props.append(props.name);
        props.remove();
        return <table width="100%" id="answer">
            <tr>
                <td colspan="2" onClick={() => answer(props, "yes")}>Да!</td>
                <td colspan="2">Да!</td>
            </tr>
            <tr>
                <td>Да!</td>
                <td>Да!</td>
                <td>Да!</td>
                <td>Да!</td>
            </tr>
            <tr>
                <td colspan="3">Да, везите скорей!</td>
                <td>Да!</td>
            </tr>
        </table>;
    }
    return <div></div>;
}
export default Table;
